    justifyContent: 'center',
    width: '100%'
}

class emergencySection extends Component{
    render(){
        return(
        <div style={style}>
            <Button onClick={()=>{console.log("hello")}} style={{width: '100%', height: '100%', fontSize: '120px', marginTop: '-5px', color: '#110052'}}>
                <MdPhoneForwarded></MdPhoneForwarded>
            </Button>
            <p style={{fontSize: '20px', marginTop: '5px'}}><strong>Emergency Contacts</strong></p>
            <Modal shouldOpen={this.state.openContacts}></Modal>
        </div>
        )}
}

export default emergencySection
